        2.6.0 2020-11-20\",\"review-status\":\"Reviewed\",\"senderemail\":\"dshelly\"},\"preferredWeight\":1,\"contents\":{\"\":{\"contentType\":\"1\",\"lastModified\":1671560356000,\"length\":1335,\"bytes\":\"<h2>Tectonic
        Summary</h2> \\n<p> \\nThe December 20, 2022, M 6.4 earthquake occurred approximately
        15 km southwest of Ferndale, California near the coast of northern California
        in the vicinity of the Mendocino triple junction \u2013 the region where the
        Pacific, North America, and Juan de Fuca/Gorda plates meet. Focal mechanism
        solutions indicate that rupture occurred as a result of strike-slip faulting
        on a steeply dipping fault striking either southeast or southwest. The location,
        depth and faulting mechanism indicate that this event likely occurred within
        the subducting Gorda Plate.\\n</p> <p>  \\nEarthquakes are common in the region
        around the Mendocino triple junction. Oblique motion between the southern
        Juan de Fuca/Gorda plate and Pacific plate causes north-south compression
        within the Gorda plate and right-lateral translation along the boundary between
        the plates. A M 6.2 event occurred approximately 20 km to the southwest of
        the 2022 M 6.4 earthquake one year prior, on December 20, 2021. In the past
        century, there have been at least 40 other earthquakes of M6 or larger, including
        six earthquakes M7 or larger, within 250 km of the December 20, 2022 earthquake.
        These prior earthquakes primarily occurred along the Mendocino transform fault,
        in the Cascadia subduction zone, or within the Juan de Fuca/Gorda plate. \\n</p>\\n\",\"sha256\":\"2hIObPwHhvFmhEwbBCDI+epFiWpI2wDzUIohIq8EkEk=\"}}}],\"ground-failure\":[{\"indexid\":\"22087959\",\"indexTime\":1671620036187,\"id\":\"urn:usgs-product:us:ground-failure:73821036:1671619990850\",\"type\":\"ground-failure\",\"code\":\"73821036\",\"source\":\"us\",\"updateTime\":1671619990850,\"status\":\"UPDATE\",\"properties\":{\"depth\":\"16.9\",\"eventsource\":\"nc\",\"eventsourcecode\":\"73821036\",\"eventtime\":\"2022-12-20T10:34:24.000Z\",\"landslide-alert\":\"yellow\",\"landslide-hazard-1std\":\"2.9499887053848455,
